<template>
  <div>
    <h1>{{ titulo }}</h1>
    <ul>
      <li v-for="foto of fotos" :key="foto.url">
        <img :src="foto.url" :alt="foto.titulo">
      </li>
    </ul>
  </div>
</template>

<script>
export default {
  data() {
    return {
      titulo: 'Alurapic',
      fotos: [
        {
          url: "data:image/jpeg;base64,",
          titulo: "cute dog"
        },
        {
          url: "data:image/jpeg;base64,",
          titulo: "doge"
        },
      ],
    }
  },
  created() {
    this.$http.get('http://localhost:3000/v1/fotos')
      .then((res) => res.json())
      .then((fotos) => this.fotos = fotos, (err) => console.log(err));
  }
}
</script>

